  //     top: 0,
  //     behavior: "smooth"
  //   });
  // }
  // scrollToTopBtn.addEventListener("click", scrollToTop);
  // document.addEventListener("scroll", handleScroll);
  return (
    <>
     <Navbar expand='sm'>
      <Container fluid>
        <Navbar.Brand className='logo' href="#home">NFT Tickets</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav  className="me-auto">
            <ul className='zebby'>
              <li>
                <Nav.Link className="nav-link" href="/">Home</Nav.Link>
              </li>
            </ul>
            </Nav>
            <Nav>
            <ButtonToolbar aria-label="Toolbar with Button groups">
            <ButtonGroup className="me-3" aria-label="First group">
              <Button className="signup" variant="outline-dark" href='/signup'>Signup</Button>
            </ButtonGroup>
            <ButtonGroup className="me-3"aria-label="First group">
              <Button className='login' href="/login">Login</Button>
            </ButtonGroup>
            </ButtonToolbar>
            <div class="btn-group rounded-pill" role="group" aria-label="Outline example">
                <button type="button" href="/login" class="btn btn-outline-primary">Left</button>
                <button type="button" class="btn btn-outline-primary">Right</button>
            </div>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
    </>
  )
}
